('AEF0004386', '18CV36 - Engineering Geology', 'Apply geological knowledge in different civil engineering practices', 'Students will acquire knowledge on durability and competence of foundation rocks, and confidence enough to use the best building material', 'Civil Engineers are competent enough for the safety, stability, economy and life of the structures that they construct.', 'Able to solve various issues related to groundwater exploration, build up dams, bridges, tunnels which are often confronted with groundwater problems', 'Intelligent enough to apply GIS, GPS and remote sensing as a latest tool in different civil engineering construction.', 'Apply the knowledge of geo informatics in construction and design of civil engineering structures', 'ENGINEERING AND GENERAL GEOLOGY-PARBIN SINGH', 'ENGINEERING GEOLOGY- CHENNAKAESHAVULU', 'REMOTE SENSING-ANJI REDDY', '0', '0', '0', 'Civil Engineering'),
('AEF00220', '17CS754 - Storage Area Network', 'Explain key challenges in managing information and develop intelligent storage system using the different components.', 'Explain components of FC-SAN, NAS and virtualization in SAN and choose different protocols for storage networking.', 'Determine backup recovery, disaster recovery, business continuity and replication.', 'Classify Cloud computing models based on characteristics and its benefits and describe the different forms of storage automation and virtualization.', 'Illustrate the security in storage infrastructure and its management. ', '0', 'Information Storage and Management,Author :EMC Education Services, Publisher: Wiley ISBN: 9781118094839', 'Storage Virtualization, Author: Clark Tom, Publisher: Addison Wesley Publishing Company ISBN : 9780321262516', '0', '0', '0', '0', 'Computer Science and Engineering'),
('AEF01041', '18CS36 - Discrete Mathematical Structures', 'Understand basic connectives, mathematical logic and quantifiers  to formulate real world  problems into mathematical models  and proof them mathematically.', 'Apply mathematical induction,counting principles like permutation ,Combination and apply them in real world Applications.', 'Evaluate to use logical notations to define and reason about fundamental mathematical concepts such as sets, relations and functions ', 'Apply principles of inclusion and Exclusion ,formulate problems and solve recurrence relations .', 'Analyse to  solve real world problems using graph theory and trees concept.', '0', 'Ralph P. Grimaldi: Discrete and Combinatorial Mathematics, 5th Edition, Pearson Education. 2004.', 'Basavaraj S Anami and Venakanna S Madalli: Discrete Mathematics  A Concept based approach, Universities Press, 2016', 'Kenneth H. Rosen: Discrete Mathematics and its Applications, 6th Edition, McGraw Hill, 2007.', '0', '0', '0', 'AIML'),
('AEF01910', '18CS54 - Automata theory and Computability', 'Demonstrate the core concepts in Automata theory and Theory of Computation', 'Construct Grammars and Automata for various language classes like RLs, CFLs and Decidable Languages.', 'Develop skills in formal reasoning and become knowledgeable about restricted models of computation such as Regular and Context free. ', 'Analyse different computational models and Develop skills in formal reasoning and reduction of problem to a formal model emphasizing on semantics.', 'Apply formal mathematical approaches and algorithms to prove decidability and intractability of computational problems. ', '0', '1.	Elaine	Rich,	Automata,	Computability	and	Complexity,	1st	Edition,	Pearson education,2012/2013', '2.	K L P Mishra, N Chandrasekaran , 3rd Edition, Theory of Computer Science, PhI, 2012.', '1.	John E Hopcroft, Rajeev Motwani, Jeffery D Ullman, Introduction to AutomataTheory, Languages, and Computation, 3rd Edition, Pearson Education, 2013', '0', '0', '0', 'Computer Science and Engineering'),
('AEF01987', '18ME753 - Industry Safety', 'Understand the basic safety terms and international standards .Report the case studies by sharing experience of the employees working in housekeeping, laboratories etc.', 'Identify the hazards and risk analysis around the work environment and industries ', 'Use the safe measures while performing work in and around the work area of the available laboratories. Able to recognize the sign boards and its application', 'Recognize the safety sign boards and its application. Recognise the types of fires extinguishers and to demonstrate the portable extinguishers used for different classes of fires', 'Recognise the chemical and electrical hazards for its prevention and control', '0', 'Industrial safety and management by L.M.Deshmukh', 'Electrical safety ,fire safety and safety mangement by S.R.Rao,R.K.Jain and Saluja', 'chemical preocess industrial safety by K.S.N.Raju', '0', '0', '0', 'Mechanical Engineering'),
('AEF02094', '18CS744 - Cryptography', 'Implement various classical ciphers and block Ciphers. ', 'Apply the knowledge of number theory in Public Key Cryptography and solve various problems.', 'Compare the  issues involved in key management and distribution', 'Demonstrate the User authentication techniques and electronics mail security in network security. ', 'Understand the security protocols used in IP Security.', '0', 'William Stallings: Cryptography and Network Security, Pearson 6th edition.', '0', '0', '0', '0', '0', 'Computer Science and Engineering'),
('AEF02345', '18CS51 - Management, Entrepreneurship for  IT industry', 'Explain the concept of management.  Discuss the importance and nature of organization, planning, staffing.', 'Discuss the importance and nature of directing, communication, co-ordination, controlling.', 'Apply the knowledge of entrepreneurial skills to Establish start-ups.', 'Identify and prepare a project by using resources available through ERP.', 'Analyse industrial policies set by government on micro and small enterprises using various Case studies.', '0', 'Principles of Management -P. C. Tripathi, P. N. Reddy; Tata McGraw Hill, 4th / 6th Edition, 2010.', 'Dynamics of Entrepreneurial Development & Management -Vasant Desai Himalaya Publishing House.', 'Entrepreneurship Development -Small Business Enterprises -Poornima M Charantimath Pearson Education  2006.', '0', '0', '0', 'Mechanical Engineering'),
('AEF02348', '17CSP78 - Project Phase-1 and Seminar', 'Understand various technologies in the areas of computer science and engineering.', 'Understand the relationship between theory and practice and the essential links between them', 'Identify the problem by applying acquired knowledge', 'Analyze The Problem with existing system', 'Design and develop solutions to solve real world problems by applying knowledge of engineering fundamentals, specialization and research based knowledge.', '0', '0', '0', '0', '0', '0', '0', 'Computer Science and Engineering'),
('AEF02348', '18CS34 - Computer Organization ', 'Explain the basic structure of computers, performance of processor, memory organization, machine instructions and assembly language.', 'Analyse and Choose appropriate interrupt hardware for communication with I/O devices. ', 'Explain different types of memory architecture and illustrate the concept of virtual memory.', 'Apply the knowledge of arithmetic operations and analyze simple arithmetic and logic units.', 'Explain the processing unit, organization of processor and pipelining.', '0', 'Carl Hamacher, Zvonko Vranesic, Safwat Zaky, Computer Organization, 5th Edition, Tata McGraw Hill,2022', '0', '0', '0', '0', '0', 'Computer Science and Engineering'),
